import React from 'react';

class Tile extends React.Component {
  constructor(props) {
    super(props);
    this.type = props.type;
    this.title = props.title;
    this.info = props.info;
    this.highlight = props.highlight;
    this.handleDrop = props.handleDrop;
    this.handleDragOver =this.handleDragOver.bind(this);
  }

  handleDragOver(e) {
    e.preventDefault();
  }

  render() {
    return (
      <div draggable="true" onDragOver={this.handleDragOver} onDrop={console.log("yes")} className="grid-tile">hi</div>
    )
  }
}

export default Tile
